const PostExcerpt = ( {post}) => {
    return (
        <article key={post.id}>
            <p>this is a postExcerpt</p>
            <h3>{post.title}</h3>
            <p>{post.content.substring(0,100)}</p>
            <p>{post.author}</p>
            <p>{post.createdAt}</p>
        </article>
    )
}

export default PostExcerpt
